Description:
West Coast Resurrection is the third independent studio album by The Game. It was released on March 29, 2005 for Get Low Recordz and was produced by JT the Bigga Figga, Sean T and G-Man Stan. The album was even more successful then his previous independent release, Untold Story, peaking at #53 on the Billboard 200, #24 on the Top R&amp;B/Hip-Hop Albums, #2 on the Top Independent Albums and #53 on the Billboard Comprehensive Albums
